import "./App.css" 
import Services from "./components/Services"
import Home from "./components/Home"
import About from "./components/About"
import Contact from "./components/Contact"
import Blog from "./components/Blog"
import Navbar from "./components/Navbar"
import Login from "./components/Login"
import Learnmore from "./components/Learnmore"
import Signup from "./components/Signup"
import { createBrowserRouter, RouterProvider,outlet } from "react-router-dom"
function App() {
    const router = createBrowserRouter([
        {
            path : "/",
            element:
            <><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Home/></>
        },
        {
            path : "/Contact",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Contact/></>
        },
        {
            path : "/Blog",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Blog/></>
        },
        {
            path : "/Services",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Services/></>
        },
        {
            path : "/Signup",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Signup/></>
        },
        {
            path : "/Login",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><Login/></>
        },
        {
            path : "/About",
            element:<><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

            <Navbar/><About/></>
        },
        {
          path:"/Learnmore",
          element: <><motion.div
  initial={{ opacity: 0, y: 20 }}
  animate={{ opacity: 1, y: 0 }}
  exit={{ opacity: 0, y: -20 }}
  transition={{ duration: 0.4 }}
>
  {/* Your page content */}
</motion.div>

          <Navbar/><Learnmore/></>
        },
    ]) 
      return(
          <>
        <RouterProvider router={router}/>
        </>
    )
}

export default App
